module.exports=[{title:"Robe of Gems",description:"Ένα οπτικά καθηλωτικό και βαθιά ανησυχαστικό ντεμπούτο (βραβευμένο με Αργυρή Άρκτο στην Μπερλινάλε του 2022), το οποίο ξεναγεί τον θεατή σε αθέατα τοπία της μεξικανικής εξοχής. Σ’ έναν τόπο που καθορίζεται από την κοινωνική αναταραχή και την εγκληματικότητα, τα πεπρωμένα τριών γυναικών συγκρούονται όταν η έρευνα γύρω από μια υπόθεση ενός αγνοούμενου ατόμου τις παρασέρνει σ’ ένα μονοπάτι πόνου και μετάνοιας. Οι τάφοι των ανταρτών στοιχειώνουν τους κατοίκους της χώρας, οι οποίοι βλέπουν τα παιδιά τους να εξαφανίζονται, ή ακόμα και να δολοφονούνται. «Το Μεξικό είναι ένας Θεός με πολλαπλά πρόσωπα και αντίστοιχα πολλές αντιθέσεις», λέει η σκηνοθέτρια, η οποία γνωρίζει από πρώτο χέρι το σκοτάδι που φέρνει την ασφυξία στους εύθραυστους κοινωνικούς δεσμούς.",url:"https://youtube.com/embed/zDO2f6bvtiQ",screenings:[["ΦΡΙΝΤΑ ΛΙΑΠΠΑ","12 Νοεμβρίου 2022 20:00","https://www.viva.gr/tickets/cinema/tiff63-robe-of-gems"]]},{title:"Άλογο του πολέμου",description:"Το Άλογο του πολέμου ακολουθεί τις αλληλένδετες ιστορίες δύο νεαρών ανδρών της φυλής Oglala Lakota, οι οποίοι μεγαλώνουν στο Πάιν Ριτζ – έναν προστατευόμενο καταυλισμό αυτόχθονων Αμερικανών στον Αμερικανικό Νότο. Ο 23χρονος Μπιλ φιλοδοξεί να κάνει πράγματα για τον εαυτό του. Είτε πρόκειται για παράδοση προϊόντων ή για εκτροφή Πουντλ, είναι αποφασισμένος να κατακτήσει σύντομα το Αμερικάνικο Όνειρο. Στο μεταξύ, ο 12χρονος Μάθο ανυπομονεί να γίνει άντρας. Αποζητώντας απεγνωσμένα την αποδοχή του πατέρα του, παίρνει μια σειρά παρορμητικών αποφάσεων που θα φέρουν τα πάνω κάτω στη ζωή του, ενώ αντιλαμβάνεται πως δεν έχει τα εφόδια για να αντιμετωπίσει τις σκληρές αλήθειες του κόσμου των ενηλίκων. Ενωμένοι με έναν άρρηκτο δεσμό λόγω της κοινής αναζήτησης του ανήκειν, τα δύο αγόρια παλεύουν με την ταυτότητά τους, τις οικογένειές τους και την απώλεια, καθώς εξερευνούν –μέσα από τους δικούς τους μοναδικούς δρόμους– την ανδρική ταυτότητα.",url:"https://www.youtube.com/embed/_mW60hoGJcQ",screenings:[["ΜΑΚΕΔΟΝΙΚΟΝ","13 Νοεμβρίου 2022 22:00","https://www.viva.gr/tickets/cinema/tiff63-war-pony"]]},{title:"Αξίωμα",description:"Ο Γιούλιους είναι ένας νεαρός υπάλληλος μουσείου, ευφραδής και αγαπητός σε όλους – στους φίλους, στους συναδέλφους και στην κοπέλα του. Μια μέρα, προσκαλεί τους συναδέλφους του σε ένα ιστιοπλοϊκό ταξίδι με το σκάφος της αριστοκρατικής οικογένειάς του. Όμως κάτι δεν πάει καλά. Ο Γιούλιους δεν είναι αυτός που φαίνεται... Μια ανατριχιαστική, ιλιγγιώδης και συναρπαστική διερεύνηση της ανησυχητικής αντίφασης ανάμεσα στο μοντέρνο ιδεώδες του αυτοπροσδιορισμού και στην ανθρώπινη συμπεριφορά που βλάπτει το σύνολο της κοινωνίας, η οποία αναπτύσσεται με αξιοθαύμαστη χάρη και ευελιξία.",url:"https://youtube.com/embed/4S0DMjV9oyU",screenings:[["ΤΩΝΙΑ ΜΑΡΚΕΤΑΚΗ","10 Νοεμβρίου 2022 16:00","https://www.viva.gr/tickets/cinema/tiff63-axiom"],["ONLINE","10 Νοεμβρίου 2022 10:00","https://online.filmfestival.gr/film/axioma-axiom/"],["ONLINE","12 Νοεμβρίου 2022 00:00","https://online.filmfestival.gr/film/axioma-axiom/"],["ONLINE","13 Νοεμβρίου 2022 00:00","https://online.filmfestival.gr/film/axioma-axiom/"],["ΤΩΝΙΑ ΜΑΡΚΕΤΑΚΗ","13 Νοεμβρίου 2022 22:00","https://www.viva.gr/tickets/cinema/tiff63-axiom"]]},{title:"Λόλα",description:"Τι θα γινόταν αν το Space Oddity του Ντέιβιντ Μπόουι μπορούσε να ακουστεί το 1941; Αυτό είναι ένα από τα πολλά ερωτήματα που θέτει η Λόλα – μια ταινία αντιπροσωπευτική της προσήλωσης του είδους της επιστημονικής φαντασίας στην τεχνολογία, στις «υποσχέσεις» της για αιώνια ευδαιμονία, αλλά και στις καταστροφικές της συνέπειες. Με καθηλωτικές ασπρόμαυρες εικόνες και πλάνα γυρισμένα σε φιλμ 16mm που αναδύουν μια αύρα «αυθεντικότητας», η ταινία ξεδιπλώνεται σ’ έναν παράλληλο χωροχρόνο. Εκεί δύο αδερφές εφευρίσκουν ένα μηχάνημα που φέρνει στις συχνότητες του οικιακού ραδιοφώνου εκπομπές από το μέλλον – του δίνουν μάλιστα το γυναικείο όνομα Λόλα, σαν να επρόκειτο για την καλύτερή τους φίλη. Όταν όμως ξεσπά ο Β΄ Παγκόσμιος Πόλεμος, η ηθική συγκρούεται με την ευθύνη, καθώς οι δύο αδερφές καλούνται να αποφασίσουν πώς θα αξιοποιήσουν αυτή τη γνώση – που, όπως ξέρουμε, είναι η απόλυτη μορφή εξουσίας.",url:"https://www.youtube.com/embed/KbphuI_7FtI",screenings:[["ΟΛΥΜΠΙΟΝ","06 Νοεμβρίου 2022 17:00","https://www.viva.gr/tickets/cinema/tiff63-lola"],["ΤΩΝΙΑ ΜΑΡΚΕΤΑΚΗ","07 Νοεμβρίου 2022 22:00","https://www.viva.gr/tickets/cinema/tiff63-lola"]]},{title:"Με τα μάτια της Ντάλβα",description:"Σε μια εποχή όπου τα φαινόμενα οικογενειακής βίας κατά των γυναικών μικρής και μεγάλης ηλικίας μοιάζει να εντείνονται (ή, τουλάχιστον, να γίνονται πλέον ορατά πέρα από τους τοίχους της οικίας), μια ταινία διερευνά το σύνθετο δίκτυο δύναμης και εξουσίας που ενθαρρύνει την κακοποίηση. Όταν η αστυνομία εισβάλλει απότομα στο σπίτι της Ντάλβα για να την μεταφέρει σε μια μονάδα ανάδοχης φροντίδας, εκείνη αρχίζει σιγά σιγά να συνειδητοποιεί πως αντιλαμβανόταν διαφορετικά την αγάπη τους με τον πατέρα της. Με τη βοήθεια της νέας της συγκατοίκου και μιας κοινωνική λειτουργού, η Ντάλβα θα μάθει πώς να είναι και πάλι παιδί. Σε αυτό το αιχμηρό ντεμπούτο, η Εμανουέλ Νικό διερευνά τις διάφορες εκδοχές της βίας που εκδηλώνονται κατά τη διάρκεια της ευάλωτης παιδικής ηλικίας, με βαθιά ευαισθησία και απαράμιλλη ευγένεια, σ’ ένα ελπιδοφόρο ταξίδι προς την επούλωση.",url:"https://www.youtube.com/embed/yHPbu4jsYTY",screenings:[["","Δεν υπάρχουν προγραμματισμένες προβολές. (｡•́︿•̀｡)",""]]},{title:"Οι πέντε διάβολοι (Les Cinq Diables)",description:"Η Βικί, ένα ιδιαίτερο και μοναχικό κορίτσι, έχει ένα μαγικό χάρισμα: μπορεί να αναπαράγει οποιαδήποτε μυρωδιά της αρέσει, και τις συλλέγει όλες σε μια σειρά από βάζα τα οποία διαχωρίζει προσεκτικά χρησιμοποιώντας καρτελάκια. Στα κρυφά, έχει «αιχμαλωτίσει» τη μυρωδιά της μητέρας της, Ζοάν, για την οποία θρέφει μια ασυγκράτητη, υπέρμετρη αγάπη. Όταν η αδερφή του πατέρα τους, η Ζουλιά, έρχεται ξαφνικά στη ζωή τους, η Βικί αναπαράγει τη μυρωδιά της και μεταφέρεται σε σκοτεινές, αρχέγονες αναμνήσεις οι οποίες την οδηγούν στην ανακάλυψη μυστικών του χωριού, της οικογένειας και της ίδιας της ύπαρξης της. Η ανφάν γκατέ του σύγχρονου γαλλικού σινεμά (συμπεριλαμβανομένης της Δάφνης Πατακιά και της ελληνικής καταγωγής Αντέλ Εξαρχοπουλος) συμπυκνώνει σε ενενήντα μόλις λεπτά το άρωμα του μύθο, του πειρασμού και της φαντασίας αιώνων.",url:"https://youtube.com/embed/D5C3U5tlu4U",screenings:[["ΦΡΙΝΤΑ ΛΙΑΠΠΑ","11 Νοεμβρίου 2022 20:00","https://www.viva.gr/tickets/cinema/tiff63-the-five-devils"]]},{title:"Ροντέο",description:"Ήδη από τις εξεγέρσεις του 2005, τα προάστια του Παρισιού επιμένουν να μας θυμίζουν συνεχώς τις σφοδρές ταξικές συγκρούσεις και τις εσωτερικές, εθνοτικές διαμάχες που χαρακτηρίζουν τη –μάλλον ανομοιογενή– γαλλική επικράτεια. Παρατηρώντας από κοντά και επί σειρά ετών μια underground κοινότητα μοτοσικλετιστών στα βόρεια του Παρισιού, μια νεαρή σκηνοθέτρια αντλεί από τη δική της προσωπική εμπειρία για να αφηγηθεί την ιστορία της Ζουλιά, μιας ασυμβίβαστης, ανεξάρτητης αμαζόνας, η οποία βρίσκει διέξοδο στο πάθος της για τις μοτοσικλέτες και στον έρωτα για τις υψηλές ταχύτητες. Ο κόσμος της είναι αυτός των αστικών «ροντέο» – των παράνομων συγκεντρώσεων όπου οι αναβάτες κάνουν επίδειξη των μηχανών τους και παράτολμων ακροβατικών. Σε μια ταινία όπου οι μοτοσυκλέτες γίνονται μηχανικά άλογα ενός σύγχρονου γουέστερν, η γυναικεία κατάσταση σε έναν ανδροκρατούμενο κόσμο εξετάζεται από μια πρωτόγνωρη σκοπιά, ενώ ταυτόχρονα αποκαλύπτονται οι όψεις της σκληρής κοινωνικής πραγματικότητας που τροφοδοτούν τις συγκρούσεις.",url:"https://youtube.com/embed/ZYbg2kJbD7M",screenings:[["","Δεν υπάρχουν προγραμματισμένες προβολές. (╥﹏╥)",""]]},{title:"Το σπουργίτι",description:"Στο μεγάλου μήκους ντεμπούτο του, ο Μάικλ Κινίρονς επιστρατεύει το ψυχολογικό σχήμα της αβάσταχτης ενοχής και το αντισταθμίζει με την ανακούφιση που μπορεί να φέρει μια καταλυτική εξομολόγηση και η συγχώρεση· αφηγείται εδώ την ιστορία του Κέβιν, ενός ατίθασου εφήβου. Ο Κέβιν δεν έχει άλλη επιλογή παρά να παρατηρεί με τρόμο τη ζωή να γλιστρά μπροστά απ’ τα μάτια του, καθώς οι συνέπειες του μυστικού του ξεδιπλώνονται μπροστά στα μάτια του. Μόνο του στήριγμα είναι ένα πουλί – ένα μικρό σπουργίτι που φυλάει στο δωμάτιο του. Μια συναρπαστική διερεύνηση της προβληματικής ανδρικής δυναμικής εντός της οικογένειας και των καταστροφικών επιπτώσεων του ψέματος, της μυστικοπάθειας και του φόβου που προξενεί η πατρική αυθεντία.",url:"https://www.youtube.com/embed/VsTBQcjHPdc",screenings:[["ΣΤΑΥΡΟΣ ΤΟΡΝΕΣ","11 Νοεμβρίου 2022 17:00","https://www.viva.gr/tickets/cinema/tiff63-the-sparrow"],["ΜΑΚΕΔΟΝΙΚΟΝ","12 Νοεμβρίου 2022 19:30","https://www.viva.gr/tickets/cinema/tiff63-the-sparrow"]]}];
